Model.P:
assignin('base','decimation',1)
Pbatt = 21e3;
Vbatt =100;
Ts = 6e-5;   % time step

Drive_Cycle_Num = 1;
warning off Simulink:Commands:LoadMdlParameterizedLink

Object.P:
image('HEV_Control_IMAGE.jpg');
port_label('input',1,'ESys');
port_label('input',2,'ICE_RPM');
port_label('input',3,'RefSpd_kph');
port_label('input',4,'VehSpd_kph');
port_label('output',1,'Mot_TReq');
port_label('output',2,'Gen_TReq');
port_label('output',3,'Thr');

if(popup_electricalvariant==1)
    set_param(gcb,'LabelModeActiveChoice','System_Level');
    set_param([gcb '/System Level'],'popup_batteryvariant',get_param(gcb,'popup_batteryvariantsystem'));
elseif(popup_electricalvariant==2)
	set_param(gcb,'LabelModeActiveChoice','Mean_Value');
    set_param([gcb '/Mean Value'],'popup_batteryvariant',get_param(gcb,'popup_batteryvariantdetailed'));
elseif(popup_electricalvariant==3)
    set_param(gcb,'LabelModeActiveChoice','Detailed');
    set_param([gcb '/Detailed'],'popup_batteryvariant',get_param(gcb,'popup_batteryvariantdetailed'));
end

%blk = find_system(gcbh, 'FollowLinks','on','SearchDepth', 1, 'Parent', gcb, 'VariantObject', get_param(gcb,'activevariant'));

ele_var = get_param(gcb,'ActiveVariant');
batt_var = get_param([gcb '/' strrep(ele_var,'_',' ') '/Battery'],'ActiveVariant');
imagestr = ['HEV_Electrical_' strrep(ele_var,'_','') '_' batt_var '_IMAGE.jpg'];
image(imagestr);

maskObj = Simulink.Mask.get(gcb);
bas_h = maskObj.getParameter('popup_batteryvariantsystem');
bad_h = maskObj.getParameter('popup_batteryvariantdetailed');
if strcmp(get_param(gcb,'popup_electricalvariant'),'System Level')
    bas_h.Visible = 'on';
    bad_h.Visible = 'off';
else
    bas_h.Visible = 'off';
    bad_h.Visible = 'on';
end
clear maskObj

image(imread('HEV_DCDC_System_IMAGE.jpg'));
port_label('RConn',1,'Bus+');
port_label('RConn',2,'Bus-');
port_label('LConn',1,'Batt+');
port_label('LConn',2,'Batt-');
text(0.05,0.5,'Out');
text(0.85,0.5,'In');
text(0.4,0.925,'Loss');
